import React from 'react'

const SchoolData = (props) => {

    return (
        <div style={props.style}>
            <h1>School Data</h1>
            <label>Please select your school:</label>
            <select>
               
            
                {props.school.schools.map((school,index)=>{
                    return (

                    <option>{school.school}</option>

                    )
                    

                   
                    
                   
                
                })}
                
            </select>
            
            <div >
                <h1>
                    Test Area
                </h1>
            <p>{props.school.schools[1].id},{props.school.schools[1].schoolName}</p>


            </div>
        </div>
    )
}

export default SchoolData
